func (g TwemojiGlyph) Draw(display drivers.Displayer, x int16, y int16, c color.RGBA) {
	idx := 12 * 12 * 2 * g.Index
	for yy := int16(0); yy < 12; yy++ {
		for xx := int16(0); xx < 12; xx++ {
			if true {
				rgb565 := uint16(TwemojiData[idx])<<8 + uint16(TwemojiData[idx+1])
				display.SetPixel(xx+x, yy+y, RGB565ToRGBA(rgb565))
			}
			idx += 2
		}
	}
}

